print('Coeficiente de correlação: {}'.format(coef))
print('p-valor: {}'.format(p))

# Kendall
coef,p = stats.kendalltau(mola1.deformacao,mola1.forca)
print('Coeficiente de correlação: {}'.format(coef))
print('p-valor: {}'.format(p))

